INSERT INTO `movies` (`movie_id`, `name`, `year`, `description`, `image`, `video`, `type_movie_id`) VALUES
(1, 'Avengers Endgame', 2019, 'Avengers: Endgame (Vengadores: Endgame en España1?) es una futura película de superhéroes basada en el grupo los Vengadores de Marvel Comics, producida por Marvel Studios y distribuida por Walt Disney Studios Motion Pictures, a ser estrenada en 2019. Es una secuela directa de la película de 2018 Avengers: Infinity War y una continuación de The Avengers (2012) y Avengers: Age of Ultron (2015), siendo la vigésimo segunda película del Universo cinematográfico de Marvel (MCU, por sus siglas en inglés). La cinta está dirigida por Anthony y Joe Russo, con un guion escrito por el equipo conformado por Christopher Markus y Stephen McFeely, y contando con la aparición de múltiples actores de películas anteriores del Universo cinematográfico de Marvel.\r\n\r\nLa película fue anunciada en octubre de 2014 como «Avengers: Infinity War – Part 2». Los Hermanos Russo se unieron para dirigir la película en abril de 2015 y en mayo, Markus y McFeely firmaron para escribir el guion. En julio de 2016, Marvel quitó el nombre de la película, refiriéndose a ella simplemente como Película sin título de Avengers. La filmación comenzó en agosto de 2017 en Pinewood Studios en el Condado de Fayette, Georgia, al mismo tiempo de la grabación de Avengers: Infinity War, y concluyó en enero de 2018. La grabación de algunas escenas adicionales tuvo lugar en el centro y la zona metropolitana de la ciudad de Atlanta.\r\n\r\nLa cinta está programada para ser lanzada en Estados Unidos el 26 de abril de 2019, en formato IMAX y 3D.\r\n\r\nCon el teaser tráiler lanzado el 7 de diciembre de 2018 se reveló que la fecha de estreno se había adelantado para el 26 abril del 2019.2?', '1561833444_avengers_endgame.jpg', 'endGame.mp4', 1),
(8, 'Venom: Let There Be Carnage', 2021, '18 meses después de los eventos de Venom, el periodista de investigación Eddie Brock lucha por adaptarse a la vida como el anfitrión del simbionte alienígena Venom, quien le otorga habilidades sobrehumanas para actuar como un justiciero letal. Brock intenta reavivar su carrera entrevistando al asesino en serie Cletus Kasady, quien también se convierte en el anfitrión de un simbionte y escapa de la prisión después de una ejecución fallida.', '1628995688_Venom.jpeg', 'venom2.mp4', 4),
(9, 'The Suicide Squad', 2021, 'Un grupo de super villanos se encuentran encerrados en Belle Reve, una prisión de alta seguridad con la tasa de mortalidad más alta de Estados Unidos. Para salir de allí harán cualquier cosa, incluso unirse al grupo Task Force X, dedicado a llevar a cabo misiones suicidas bajo las órdenes de Amanda Waller. Fuertemente armados son enviados a la isla Corto Maltese, una jungla repleta de enemigos.', '1628994915_suicidesquad2.jpeg', 'escuadron2.mp4', 1),
(10, 'Cruella', 2021, 'Decidida a convertirse en una exitosa diseñadora de moda, una joven y creativa estafadora llamada Estella se asocia con un par de ladrones para sobrevivir en las calles de Londres. Sin embargo, cuando su talento para la moda llama la atención de la legendaria diseñadora, la Baronesa von Hellman, Estella cambia el rumbo de su vida hasta que una serie de acontecimientos la llevan a asumir su lado malvado y a convertirse en la estridente y vengativa Cruella.', '1628995069_cruella.jpeg', 'cruella.mp4', 5),
(11, 'Encanto', 2021, 'Encanto relata la historia de una familia extraordinaria; los Madrigales, quienes viven escondidos en en algún lugar del Valle de Cocora en la Cordillera de los Andes de Colombia, en una casa mágica, un pueblo vibrante y en un lugar maravilloso llamado Encanto. La magia del Encanto ha bendecido a cada niño de la familia con un don único, desde la superfuerza hasta el poder de sanar. A todos, excepto Mirabel.\r\nPero cuando la magia que rodea al Encanto está en peligro, Mirabel decide que ella, la única Madrigal sin poderes, puede ser la única esperanza de su excepcional familia.', '1628995477_encanto.jpeg', 'encanto.mp4', 6),
(12, 'Luca', 2021, 'En un hermoso pueblo en la Riviera italiana, Luca comparte sus aventuras de verano con su nuevo mejor amigo: un monstruo marino que se convierte en humano cuando está seco.', '1628998617_luca.jpeg', 'luca.mp4', 6);
